import React from 'react';
import { useDispatch } from 'react-redux';
import { Snackbar, Alert } from '@mui/material';
import cayPic from '../../assets/cayin-tarihcesi-ve-turkiyeye-gelisi-c812539d-a158-4205-b031-724dd2fe3530.jpg';
import turkKahvesiPic from '../../assets/turkkahve.jpg';
import bitkiCayiPic from '../../assets/bitkicay.jpg';
import filtreKahvePic from '../../assets/filtrekahve.webp';
import americanoPic from '../../assets/americano.jpeg';
import lattePic from '../../assets/latte.jpg';
import espressoPic from '../../assets/espresso.jpg';
import salepPic from '../../assets/salep.jpg';
import dibekKahvesiPic from '../../assets/dibek_kahve.jpg';
import capuccinoPic from '../../assets/capuccino.jpg';
import sicakcikolataPic from '../../assets/sicakcikolata.jpg';
import mochaPic from '../../assets/mocha.jpg';
import './HotDrinksPage.css';

function HotDrinksPage() {
  const dispatch = useDispatch();
  const [open, setOpen] = React.useState(false);
  const [message, setMessage] = React.useState('');

  const addToCart = (item) => {
    dispatch({ type: 'ADD_ITEM', payload: item });
    setMessage(`${item.name} sepete eklendi!`);
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div>
      <div className="frames-container">
        <div className="frame" onClick={() => addToCart({ name: 'Çay' })}>
          <img src={cayPic} alt="Çay" />
          <div className="frame-label">Çay</div>
        </div>
        <div className="frame" onClick={() => addToCart({ name: 'Türk Kahvesi' })}>
          <img src={turkKahvesiPic} alt="Türk Kahvesi" />
          <div className="frame-label">Türk Kahvesi</div>
        </div>
        <div className="frame" onClick={() => addToCart({ name: 'Bitki Çayı' })}>
          <img src={bitkiCayiPic} alt="Bitki Çayı" />
          <div className="frame-label">Bitki Çayı</div>
        </div>
        <div className="frame" onClick={() => addToCart({ name: 'Filtre Kahve' })}>
          <img src={filtreKahvePic} alt="Filtre Kahve" />
          <div className="frame-label">Filtre Kahve</div>
        </div>
        <div className="frame" onClick={() => addToCart({ name: 'Americano' })}>
          <img src={americanoPic} alt="Americano" />
          <div className="frame-label">Americano</div>
        </div>
        <div className="frame" onClick={() => addToCart({ name: 'Latte' })}>
          <img src={lattePic} alt="Latte" />
          <div className="frame-label">Latte</div>
        </div>
        <div className="frame" onClick={() => addToCart({ name: 'Espresso' })}>
          <img src={espressoPic} alt="Espresso" />
          <div className="frame-label">Espresso</div>
        </div>
        <div className="frame" onClick={() => addToCart({ name: 'Salep' })}>
          <img src={salepPic} alt="Salep" />
          <div className="frame-label">Salep</div>
        </div>
        <div className="frame" onClick={() => addToCart({ name: 'Dibek Kahvesi' })}>
          <img src={dibekKahvesiPic} alt="Dibek Kahvesi" />
          <div className="frame-label">Dibek Kahvesi</div>
        </div>
        <div className="frame" onClick={() => addToCart({ name: 'Mocha' })}>
          <img src={mochaPic} alt="Mocha" />
          <div className="frame-label">Mocha</div>
        </div>
        <div className="frame" onClick={() => addToCart({ name: 'Capuccino' })}>
          <img src={capuccinoPic} alt="Capuccino" />
          <div className="frame-label">Capuccino</div>
        </div>
        <div className="frame" onClick={() => addToCart({ name: 'Sıcak Çikolata' })}>
          <img src={sicakcikolataPic} alt="Sıcak Çikolata" />
          <div className="frame-label">Sıcak Çikolata</div>
        </div>
      </div>

      <Snackbar open={open} autoHideDuration={3000} onClose={handleClose}>
        <Alert onClose={handleClose} severity="success">
          {message}
        </Alert>
      </Snackbar>
    </div>
  );
}

export default HotDrinksPage;
